Queen of Tigers

Nature Documentary hosted by Colin Stafford-Johnson, published by BBC broadcasted as part of BBC Natural World series in 2012 - English narration


Information
------------------------------

Machli is the most famous tiger in the world - the star of five films, her own Facebook page and over a million YouTube hits on footage of her attacking a crocodile. Wildlife cameraman Colin Stafford-Johnson returns to find his old friend one last time as Machli enters the last season of her life. This documentary showcases the extraordinary milestones in Machli's life as a wise mother and a brave fighter, all set in the most stunning Indian scenery.

